import React, { Fragment } from "react";

import { Layout, Card, Row, Col, Form, Input } from "antd";
const PersonalCabinet = () => {
  return (
    <Fragment>
      <Layout>
        <Layout.Content style={{ margin: "5em 16px" }}>
          <div
            style={{
              background: "#fff",
              padding: 44,
              minHeight: 380
            }}
            className="border secondary"
          >
            <Row>
              <Col xs={12}>
                <Card
                  style={{ width: "300px" }}
                  title="Information"
                  className="text-center"
                >
                  <Form>
                    <Form.Item>
                      <Input />
                    </Form.Item>
                  </Form>
                </Card>
              </Col>
              <Col></Col>
            </Row>
          </div>
        </Layout.Content>
      </Layout>
    </Fragment>
  );
};

export default PersonalCabinet;
